export const Card = (props) => {
    return (

        <StyledCardWrapper>
            <StyledImage src={props.poster_path} />
            <StyledText>
                {props.title}
            </StyledText>
            <p>{props.overview}</p>
        </StyledCardWrapper>

    )
}

